Table S23
morphometric variation across all specimens combined. Body slightly compressed, with dorsal profile slightly more steeply angled than ventral profile, which is similarly convex. Dorsal profile begins with concave notch behind upper lip, steep rise, convex to interorbital, straight to occiput, convex to dorsal fin origin, convex to just beyond base of last dorsal ray, then horizontal to caudal fin base. Ventral profile on underside of head straight and angled downward, convex from back of head to last soft anal ray, then horizontal to caudal fin base. Lateral line continuous from behind head to base of caudal fin, and approximately parallel to dorsal profile. Body depth at dorsal fin origin 34.3 (31.8–37.1) % SL; body depth at anal fin origin 30.4 (28.2–32.8) % SL; caudal peduncle length 17.5 (16.5–18.9) % SL; caudal peduncle depth 12.6 (11.9–13.8) % SL; pre-anus length 67.2 (66.7–68.8) % SL. Head length 30.1 (29.3–30.8) % SL; head pointed; snout length 45.3 (43.6–47.5) % HL; upper-jaw length 32.5 (31.3–35.3) % HL; jaws equal throughout development; jaw width 36.1 (33.9–40.0) % HL. Teeth laterally compressed, narrow and short relative to 

Syncomistes

, ‘peg-shaped’ with anterior and posterior edges running straight and parallel from tooth base, tapering slightly at apical region to a rounded point (Tooth Morphotype 4; 

Fig. 
6g

); teeth fitted closely together but not overlapping, laterally pointed in lower jaw, extending beyond outer edge of lip. Outer row of large teeth with 4 inner rows of smaller teeth on both jaws, embedded in jelly-like gum, reducing in size towards back rows; teeth on outer row of upper jaw 114 (70–137) number varying with size, 8.1 (5.9–11.3) / mm when standardised with upper jaw length; teeth on outer row of lower jaw 117 (70–142) number varying with size, 8.8 (7.9–10.2) / mm when standardised with upper jaw length; toothless medial hump present on dorsal surface at symphysis of lower jaw, opposite toothless region of upper jaw; lower jaw distinctly V-shaped in adults and rounded in juveniles (<
65 mm
) when viewed from below, wider than it is long (Morphotype 4; 
Fig. 5d
). Lower jaw flattened when viewed laterally. Orbital diameter 20.3 (18.1–25.0) % HL; inter-orbital width 30 (27.3– 33.6) % HL; inter-orbital smooth and not scaled; post-orbital length 38 (37.8–39.5) % HL. Lower opercular spine is longer and more robust than upper opercular spine, sometimes extends beyond edge of opercular membrane; Preopercular spines serrate, reducing in size dorsally and anteriorly, anteriormost spine just behind mid-point of orbit. Intestinal pattern of adults highly convoluted; large amount of looping to left of stomach; juveniles with less convoluted pattern.
